import React, { useEffect, useState } from "react";
import { collection, getDocs, query, orderBy } from "firebase/firestore";
import { db } from "../firebaseConfig";
import { useNavigate } from "react-router-dom";

const AttendanceLogs = () => {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  // ✅ Fetch attendance logs
  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const logsQuery = query(collection(db, "attendanceLogs"), orderBy("date", "desc"));
        const querySnapshot = await getDocs(logsQuery);
        const logsData = querySnapshot.docs.map((doc) => ({
          id: doc.id,
          ...doc.data(),
        }));
        setLogs(logsData);
      } catch (error) {
        console.error("Error fetching attendance logs:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchLogs();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 flex">
      {/* Sidebar */}
      <div className="w-64 bg-white shadow-lg flex flex-col">
        <div className="p-6 border-b border-gray-200">
          <h1 className="text-2xl font-bold text-center text-blue-700">ADVENT</h1>
        </div>
        <nav className="flex flex-col p-4 space-y-2 text-gray-700">
          <button
            onClick={() => navigate("/admin/dashboard")}
            className="text-left px-4 py-2 rounded-lg hover:bg-blue-100"
          >
            Dashboard
          </button>
          <button
            onClick={() => navigate("/admin/manage-events")}
            className="text-left px-4 py-2 rounded-lg hover:bg-blue-100"
          >
            Manage Events
          </button>
          <button
            onClick={() => navigate("/admin/add-event")}
            className="text-left px-4 py-2 rounded-lg hover:bg-blue-100"
          >
            Add Event
          </button>
          <button
            onClick={() => navigate("/admin/attendance-logs")}
            className="text-left px-4 py-2 rounded-lg bg-blue-600 text-white"
          >
            Attendance Logs
          </button>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-8">
        <h2 className="text-3xl font-semibold text-gray-800 mb-6">Attendance Logs</h2>

        {loading ? (
          <div className="text-center text-gray-500">Loading attendance logs...</div>
        ) : logs.length === 0 ? (
          <div className="text-center text-gray-500">No attendance logs found.</div>
        ) : (
          <div className="overflow-x-auto bg-white shadow-md rounded-lg">
            <table className="min-w-full border border-gray-200">
              <thead className="bg-blue-600 text-white">
                <tr>
                  <th className="py-3 px-6 text-left text-sm font-semibold">Date</th>
                  <th className="py-3 px-6 text-left text-sm font-semibold">Event Title</th>
                  <th className="py-3 px-6 text-left text-sm font-semibold">Name</th>
                  <th className="py-3 px-6 text-left text-sm font-semibold">Email</th>
                  <th className="py-3 px-6 text-left text-sm font-semibold">Status</th>
                </tr>
              </thead>
              <tbody>
                {logs.map((log, index) => (
                  <tr
                    key={log.id}
                    className={`${
                      index % 2 === 0 ? "bg-gray-50" : "bg-white"
                    } border-b border-gray-200`}
                  >
                    <td className="py-3 px-6 text-sm text-gray-700">
                      {new Date(log.date?.toDate ? log.date.toDate() : log.date).toLocaleDateString()}
                    </td>
                    <td className="py-3 px-6 text-sm text-gray-700">{log.eventTitle}</td>
                    <td className="py-3 px-6 text-sm text-gray-700">{log.name}</td>
                    <td className="py-3 px-6 text-sm text-gray-700">{log.email}</td>
                    <td className="py-3 px-6">
                      <span
                        className={`px-3 py-1 rounded-full text-xs font-semibold ${
                          log.status === "Present"
                            ? "bg-green-100 text-green-700"
                            : "bg-red-100 text-red-700"
                        }`}
                      >
                        {log.status}
                      </span>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default AttendanceLogs;
